window.bookSummaryJSON = "<p>James Davenport can't help but spy on Brody Medders, hoping to catch a glance of the sexy fireman. But he's not the only one watching Brody. A twisted past of lies, drugs, and deception has caught up to Brody and now he's in danger. After Brody is hit by a car, James comes to his rescue. James values honesty, but there is more to Brody's story than he's willing to share. On Wild Bluff, Marshal is dealing with injuries that have sidelined him. Doubts about their relationship surface, driving a wedge between Zander and Marshal. A mission in Brazil requires Zander's attention, leaving Marshal alone on the ranch. In Texas, Mike Jarred informs Connor Ellison that he's headed to Brazil for work while Connor visits Lane and Gresh at Crazy Hills ranch. When Colorado and Texas collide, you never know what will happen.</p>"; 
